import './App.css';
import pic from './assets/yogi.jpg'

function App() {
  return (
    <div className='photo_card'>
      <img className="yogiPic" src={pic} alt ="yogendra pic" />
      <div>
        Hello All.
      </div>
    </div>
  );
}

export default App;
